import React from 'react';

import './Resume.css';
import Square from '../../components/Square/Square';

const Resume = () => (
  <div className='cv__resume'>
    <Square height={18} width={18} color={{ r: 133, g: 29, b: 252 }} />
    <h1>Resume</h1>
    <div>
      <h2>S</h2>
    </div>
  </div>
);

export default Resume;
